// components/GraphPanel.js

import React from 'react';
import sampleImg from "../assets/img/sample_img.png"


const GraphPanel = () => {
  // Placeholder content for the GraphPanel
  return (
    <div className="graph-panel-container">
      {/* You can add settings display functionality here */}
      <h2>Scene Graph</h2>
      <img src={sampleImg} alt="a sample img" className='graph-panel-img'></img>
    </div>
  );
};

export default GraphPanel;
